import './App.css';
import {Route, Routes} from "react-router-dom";
import Affiliatelandingpage from "./pages/Affiliatelandingpage"
import Affiliateregistrationpage from "./pages/Affiliateregistrationpage"
import Brandlandingpage from "./pages/Affiliatelandingpage"


function App() {
  return (
    <div>
      <Routes>
      <Route path="/" element={<div>1</div>}/>
      <Route path="/affiliate" element={<Affiliatelandingpage/>}/>
      <Route path="/register" element={<div>3</div>}/>
      <Route path="/affiliate/register" element={<div>4</div>}/>
      </Routes>
    </div>
  );
}

export default App;
